<script>
window.testw = {};
testw.list = [];
testw.testId = function(p) {
	p.childNodes.forEach( e => {
		let id = $.nullToString(e.id).trim();;
		if (id != "" && testw.list.contains(id))
			console.log("duplicate: " + id);
		else if(id != "") testw.list.push(id);
			testw.testId(e);
	})
}

</script>
